def readDataFrameFromParquet(parquetFileName:String):org.apache.spark.sql.DataFrame = {
    val dataFrame = spark.read.parquet(parquetFileName)
    return dataFrame
}

def writeDataFrameToParquet(dataFrame:org.apache.spark.sql.DataFrame, parquetFileName:String ) = {
    dataFrame.write.mode(org.apache.spark.sql.SaveMode.Overwrite).parquet(parquetFileName)
}

