def getEncounterDateRanges(clientCode:String,esIndexName:String,esHost:String,esPort:Int) :org.apache.spark.sql.DataFrame = {
    val encounterMinAdmitSourceQuery = s"""
    {  
      "size": 0,
      "stored_fields": ["admit_date"],
      "query": {
        "constant_score": {
          "filter": {
            "bool": {
              "must": [
                {"term":{"client_code" : "$clientCode" }},
                { "range": {"admit_date": {"gte": "now-100y", "lte": "now"}}}
              ]
            }
          }
        }
      },
      "aggs": {
            "min_admit" : { "min": {"field" : "admit_date"}}
      }
    }
    """
    // Find the minimum admit date (in the last 6 years) for a given client (DEMO)

    // generate the elasticsearch request string

    val endPoint = "/"+ esIndexName + "/encounter/_search"
    val request_url = "http://" + esHost + ":" + esPort + endPoint

    // build the apache HTTP post request
    val post = new HttpPost(request_url)
    // set header for json request string
    val setHeaderReturn = post.setHeader("Content-type","application/json")
    // ad the json request string to the http post
    val setEntityReturn = post.setEntity(new StringEntity(encounterMinAdmitSourceQuery))
    // send the request to elasticsearch
    val response = (new DefaultHttpClient).execute(post)
    // get the status -- this code doesn't check for HTTP/1.1 200 OK response but the final code should!
    val status = response.getStatusLine
    // get the json response body
    val responseBody = (new BasicResponseHandler).handleResponse(response).trim.toString

    // use a spark RDD to parse json response body
    // val vals = sc.parallelize(responseBody ::  Nil)
    // query RDD to extract relevant json key (aggregations.min_admit.value)
    val df = sqlContext.read.json(sc.parallelize(responseBody::Nil)).select($"aggregations.min_admit.value")
    // convert unix epoch time to java date
    //val min_admit = new Date(Math.round(df.first().getDouble(0)))
    // truncate that date to the first of the month
    val min_admit_month = DateUtils.truncate(new Date(Math.round(df.first().getDouble(0))), Calendar.MONTH)
    // generate the max admit as the first day of the current month (minus one second - for elasticsearch bounds checking convenience)
    val max_admit_month = DateUtils.addSeconds(DateUtils.addMonths(DateUtils.truncate(new Date(), Calendar.MONTH),1),-1)
    // maximum admit month plus one month - for specific use cases related to nasty date math below
    val max_admit_month_next = DateUtils.addMonths(DateUtils.truncate(new Date(), Calendar.MONTH),1)


    val min_admit_month_string = (new SimpleDateFormat("yyyy-MM-dd")).format(min_admit_month)
    val max_admit_month_string = (new SimpleDateFormat("yyyy-MM-dd HH:mm:ss")).format(max_admit_month)
    val max_admit_month_next_string = (new SimpleDateFormat("yyyy-MM-dd")).format(max_admit_month_next)

    val min_admit_month_epoch = min_admit_month.getTime()
    val max_admit_month_epoch = max_admit_month.getTime()

    val current_state_high_level = "Prospect"
    val current_state_specific = "Prospect"

    val previous_state_high_level = "Prospect"
    val previous_state_specific = "Prospect"



    val objDateRanges =new clsDateRanges(
        previous_state_high_level,
        previous_state_specific,
        current_state_high_level,
        current_state_specific,
        java.sql.Date.valueOf(min_admit_month_string),
        java.sql.Timestamp.valueOf(max_admit_month_string),
        java.sql.Date.valueOf(max_admit_month_next_string),
        min_admit_month_epoch,
        max_admit_month_epoch,
        min_admit_month_string,
        max_admit_month_string)

    val seqDateRanges = Seq(objDateRanges)
    val dateRanges = seqDateRanges.toDF()
    return dateRanges
}

def getEncounterSourceData(clientCode:String,esIndexName:String) :org.apache.spark.sql.DataFrame = {

    val encounterSourceQuery = s"""
    {  
      "query": {
        "constant_score": {
          "filter": {
            "bool": {
              "must": [
                {"term":{"client_code" : "$clientCode" }},
                {"has_parent" : {
                    "parent_type": "person",
                    "query": {
                      "bool": {
                        "must": [
                          { "range": {"last_name": {"gte":"A","lte":"B"}}}
                        ]
                      }
                    }
                  }
                }
              ]
            }
          }
        }
      }
    }
    """
    // limit the fields that are included
    val encounterSourceQueryOptions = Map(
    //  "es.read.field.include" -> "recordId,parent,admit_date,service_category,facility.code,patient_lifecycle.*"
      "es.read.field.exclude" -> "person_key,encounter_key,admit_age,admit_source,admit_type,client_code,client_name,discharge_date,encounter_type,financial_class,msdrg,service_sub_category,diagnosis,cpt,procedure,campaigns,total_charges,total_amount_received,expected_reimbursement,direct_costs,actual_contribution_margin,expected_contribution_margin,recency_frequency"
      )

    val encountersES = sqlContext.esDF(s"${esIndexName}/encounter", encounterSourceQuery, encounterSourceQueryOptions)

    return encountersES
}

